import React from 'react';
import NavBar from './NavBar.j'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 class="text-color center-text"> Portfolio de Samuel </h1>
        <p class="center-text-description">
        Hello ! Je m'appelle Samuel. Je suis un étudiant à Epitech.
        </p>
      </header>
      <NavBar/>
    </div>
  );
}

export default App;
